import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div className="App">
      <Header />
        <ul>
          <li>First item</li>
          <li>Second item</li>
        </ul>
      </div>
    );
  }

  const Header = () => {
    return (
      <div className="Header">
        <ol>
          <li>Home</li>
          <li>News</li>
          <li>Credits</li>
        </ol>
      </div>
    );
  }

export default App;
